function rss = meritDMSO(params,helper)

%Unpack the helper
x = helper{1};
plotI = helper{3};

%ITC conditions
V = 200e-6;     %Volume of the cell
E = 115e-6;    %Concentration of Enzyme
S = 362e-6;


inj = [0,2.5,2.5]*1e-6;
injTime = [0,5,5];
syr = [0,0,E];  
cel = [S,0,0];  

% params = 305;
rss = runFit(params,x,inj,syr,cel,V,0,injTime,helper);



if plotI > 0
runFit(params,x,inj,syr,cel,V,plotI,injTime,helper); 
end


end


function rss = runFit(params,x,inj,syr,cel,V,plotI,injTime,helper)

%So we need to do a bit of set up in the merit function to start
