t0 = [];


%Unpack the parameters
kcat = params(1);
Km = params(2);
H = params(3);




for i = 1:length(x.inj)
    t = x.inj{i}-min(x.inj{i});
    I = [];
    
    if injTime(i) >= 1
    tinj = 0:injTime(i);
    dilRate = -(V+inj(i))/injTime(i);
    injRate = syr*inj(i)/(V*injTime(i));
    
    [~,I] = ode15s(@(t,C)michaelismentenODE(t,C,[kcat,Km],injRate,dilRate),tinj,cel,options);
    cel = I(end,:);
    t = t(tinj(end)+1:end);
    end
    
    [~,S] = ode15s(@(t,C)michaelismentenODE(t,C,[kcat,Km],[0,0,0],[0,0,0]),t,cel,options);
   
