        dF = michaelismentenODE(0,C(j,:),[kcat,Km],[0,0,0],[0,0,0]);
        dFdC(j) = dF(2); 
    end
    
    %Now we update the contents of the cell for the next injection
    cel = C(end,:); 
    
    
    %Then we translate the simulation into the units we use on the ITC
    dFdC = dFdC(:)*1e6; %rates put into uM/s
    P = dFdC*1000*V*H; %uM/s transoformed into ucals/s
    t0 = [t0;x.inj{i}];
    Y = [Y;P(:)];

